browser.runtime.onStartup.addListener(() => {
  greet();

  let gettingItem = browser.storage.local.get();
  gettingItem.then((obj) => {
    let currEpoch = Math.round((new Date()).getTime());
    Object.values(obj).forEach((reminderObj) => {
      if (reminderObj.uepoch < currEpoch && reminderObj.upcoming == "true") {
        createNotification (reminderObj.rmd);
        reminderObj.upcoming = "false";
        browser.storage.local.set({[reminderObj.key] : reminderObj});
      } else if (reminderObj.uepoch > currEpoch && reminderObj.upcoming == "true") {
        setAlarm(reminderObj, reminderObj.key);
      }
    });
  }, onError);
});

browser.runtime.onInstalled.addListener((details)=> {
  console.log(details.reason);
  greet();

  // Setting the default settings options - Start
  var s1 = precedor + 'Show-Notifications';
  var s2 = precedor + 'Make-sound-on-Notification';
  var s3 = precedor + 'Snooze-Time';
  var s4 = precedor + 'Show-Ongoing-or-Upcoming';
  var s5 = precedor + 'Show-Color-Reminder';
  var s6 = precedor + 'Greet-me-with-Good-Morning-or-Evening-or-Afternoon';
  var s7 = precedor + 'Notification-Sound';

  browser.storage.local.set({[s1]: 'Yes'});
  browser.storage.local.set({[s2]: 'Yes'});
  browser.storage.local.set({[s3]: '1'});
  browser.storage.local.set({[s4]: 'Ongoing'});
  browser.storage.local.set({[s5]: 'All'});
  browser.storage.local.set({[s6]: 'Yes'});
  browser.storage.local.set({[s7]: 'Pling'});
  // Setting the default settings options - End

  if (details.reason == "install") createNotification(FIRSTMSG);
  else {
      createNotification(URGNTMSG);
      createNotification(UPDMSG);
  }
});

function greet() {
  /* Greeting Message */
  let greetStatus = browser.storage.local.get(precedor + SETSGREET);
  greetStatus.then(obj => {
      if (obj[precedor + SETSGREET] == 'Yes') {
          let tTime = (new Date()).getHours();
          let gMsg = "";
          if (tTime >= 3 && tTime < 12) gMsg = "Good Morning! :)";
          else if (tTime >= 12 && tTime < 18) gMsg = "Good Afternoon! :)";
          else gMsg = "Good Evening! :)";
          createNotification(gMsg, true);
      }
  })

}

function createNotification (reminder, greet=false) {
    let makeSound = browser.storage.local.get(precedor + SETSSOUND);
    makeSound.then(obj => {
        if (obj[precedor + SETSSOUND] == 'Yes') {
            let sound = browser.storage.local.get(precedor + SETSAUDIO);
            sound.then(obj => {
                makeNotiSound(obj[precedor + SETSAUDIO].toLowerCase());
            })
        }
    });

    let createNoti = browser.storage.local.get(precedor + SETSNOTI);
    createNoti.then(obj => {
        if (obj[precedor + SETSNOTI] == 'Yes' || greet) {
            browser.notifications.create({
              "type": "basic",
              "title": "Assitant Reminder Says: ",
              "message": reminder,
              "iconUrl": "../icons/asst-reminder-32.png"
            });
        }
    });
}

function clearThisAlarm(key) {
  browser.alarms.clear(key);
}

function deleteAll () {
  browser.alarms.clearAll();
  //browser.storage.local.clear();
  let gettingItem = browser.storage.local.get();
  gettingItem.then(obj => {
      Object.values(obj).forEach(reminderObj => {
          if (reminderObj.key != undefined) {
              browser.storage.local.remove(reminderObj.key);
          }
      });
  });
}

function onError (error) {
  console.log(`${error}`);
}

function makeNotiSound(aud) {
    let pling = "";

    let blop = "";

    let ting = "";

    let whip = "";

    let popcork = "";

    console.log(aud.split(' ').join(''));
    switch (aud.split(' ').join('')) {
        case 'pling':
            snd = new Audio("data:audio/wav;base64," + pling);
            break;
        case 'whip':
            snd = new Audio("data:audio/wav;base64," + whip);
            break;
        case 'blop':
            console.log('blop');
            snd = new Audio("data:audio/wav;base64," + blop);
            break;
        case 'popcork':
            snd = new Audio("data:audio/wav;base64," + popcork);
            break;
        case 'ting':
            snd = new Audio("data:audio/wav;base64," + ting);
            break;
        default:
            break;
    }

    snd.load();
    snd.play();
    delete snd;
}
